// jsPDF lib =========================

// Since images are loaded asyncronously, we must wait to create
// the pdf until we actually have the image data.
// If we already had the jpeg image binary data loaded into
// a string, we create the pdf without delay.
var createPDF = function(imgData) {
  /*
  p: portrait
  mm: millimeters unit
  pt: point unitl
  a4: A4
  */
  var doc = new jsPDF('p', 'pt', 'a4');
  var page_margin = 50; // pt
  var _x = page_margin,
    _y = page_margin; // _y keep tracks of current vertical position
  var lineHeight = 12;
  var header1_font = 20;
  var header2_font = 16;
  var font = 12;

  // Optional - set properties of the document
  doc.setProperties({
    title: "PEWI Results",
    subject: "All Rights Reserved@hschang",
    author: 'LESEM LAB',
    creator: 'Flyer Builder & jsPDF'
  });

  // addText
  // fonts initializing
  // doc.setFont("helvetica");
  doc.setFontType("bold");
  doc.setFontSize(header1_font);
  doc.text(_x, _y, 'PEWI Results');

  _y += header1_font + lineHeight; //updat y

  doc.setFontType("normal");
  doc.setFontSize(font);
  doc.text(_x, _y, 'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Confectum ponit legam, perferendis \nnomine miserum, animi. Moveat nesciunt triari naturam.\n\n');

  _y += font + lineHeight * 2; //updat y

  doc.setFontType("bold");
  doc.setFontSize(header2_font);
  doc.text(_x, _y, 'Graphics');

  _y += header2_font + lineHeight; //updat y

  // addImage(src, X, Y, width, height)
  // doc.addImage(imgData, 'JPEG', 10, 10, 50, 50);
  doc.addImage(imgSrc, 'JPEG', _x, _y, 250, 150);

  _y += 150 + lineHeight;

  doc.text(_x, _y, 'Hello');

  // Output as Data URI on the current page
  doc.output('datauri');

  // // prompt saving
  // doc.save('testtttt.pdf');
};

// Because of security restrictions, getImageFromUrl will
// not load images from other domains.  Chrome has added
// security restrictions that prevent it from loading images
// when running local files.  Run with: chromium --allow-file-access-from-files --allow-file-access
// to temporarily get around this issue.
var getImageFromUrl = function(url, callback) {
  var img = new Image(),
    data, ret = {
      data: null,
      pending: true
    };

  img.onError = function() {
    throw new Error('Cannot load image: "' + url + '"');
  };
  img.onload = function() {
    var canvas = document.createElement('canvas');
    document.body.appendChild(canvas);
    canvas.width = img.width;
    canvas.height = img.height;

    var ctx = canvas.getContext('2d');
    ctx.drawImage(img, 0, 0);
    // Grab the image as a jpeg encoded in base64, but only the data
    data = canvas.toDataURL('image/jpeg').slice('data:image/jpeg;base64,'.length);
    // Convert the data to binary form
    data = atob(data);
    document.body.removeChild(canvas);

    ret.data = data;
    ret.pending = false;
    if (typeof callback === 'function') {
      callback(data);
    }
  };
  img.src = url;

  return ret;
};

